import React from "react";
import { Map } from "react-kakao-maps-sdk";

const MapList = () => {
  return (
    <Map
      center={{ lat: 33.5563, lng: 126.79581 }}
      style={{ width: "100vw", height: "calc(100vh-80px)" }}
      level={3}
    ></Map>
  );
};

export default MapList;
